import React, { Component } from "react";
import "./App.css";
import { BrowserRouter as Router, Route, Switch, Link } from "react-router-dom";
import Home from "./components/Home";
import About from "./components/About";

class App extends Component {
  render() {
    return (
      <div>
        <Router>
          <Switch>
            <Route exact path="/" />
            <Home />
            <Route path="/about" />
            <Link to="/">about</Link>
            <About />
          </Switch>
        </Router>
      </div>
    );
  }
}
export default App;
